import React, {useState} from 'react'

const EditProduct = (props) => {
    const [editing, setEditing] = useState(false)

    return (
        <>
            {!editing&&<button
                type = "button"
                onClick={()=>{setEditing(true)}}
                >Edit
            </button>
                
            }
        </>
    )
}

export default EditProduct
